import bottles from '../images/bottles.jpg'
import './card-styling.css'
function Card(){
    const price=310;
    return (
        <div className='card-container'>
            <img className='card-image' src={bottles} alt="bottles"/>
            <p className='card-heading'>Bottle</p>
            <p className="card-description">Bottle Description</p>
            <p className="bottle-price">Price: {`$ ${price}`}</p>
        </div>
    )
}
export default Card;
